/* /components/Layout.js */

import React, { useContext } from "react";
import Head from "next/head";
import { Container, Nav, NavItem, NavLink, Alert, Navbar } from "reactstrap";
import { useAuth } from "../lib/auth2";
import Cart from "./cart";
import AppContext from "./context";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCartShopping, faUser } from "@fortawesome/free-solid-svg-icons";

const Layout = (props) => {
  const title = "Capstone Delivery App";
  const { cart } = useContext(AppContext);
  console.log(` CART ${cart.items.length}`);
  var { user, setUser, logout } = useAuth();

  return (
    <div>
      <Head>
        <title>{title}</title>
        <meta charSet='utf-8' />
        <meta
          name='viewport'
          content='initial-scale=1.0, width=device-width'
        />
        <script src='https://js.stripe.com/v3' />
      </Head>
      <header>
        <style jsx>
          {`
            a {
              color: white;
            }
            h5 {
              color: white;
              padding-top: 11px;
            }
          `}
        </style>

        <Navbar className='navbar-expand-lg'>
          <NavItem>
            <NavLink href='/'>
              <a className='navbar-brand'>Home</a>
            </NavLink>
          </NavItem>

          <NavItem>
            <NavLink href='/display'>
              <a className='ml-auto'>Display</a>
            </NavLink>
          </NavItem>

          <NavItem className='ml-auto'>
            {user ? (
              <h5>{user.username}</h5>
            ) : (
              <NavLink href='/register'>
                <a className='nav-Navlink'> Sign up</a>
              </NavLink>
            )}
          </NavItem>

          <NavItem>
            {cart.items.length > 0 && (
              <>
                <p>{cart.items.length}</p>
                <FontAwesomeIcon icon={faCartShopping} />
              </>
            )}
          </NavItem>

          <NavItem>
            {user && (
              <NavLink href='/profile'>
                <a className='nav-Navlink'>
                  <FontAwesomeIcon icon={faUser} />
                </a>
              </NavLink>
            )}
          </NavItem>
          <NavItem>
            {user ? (
              <NavLink href='/'>
                <a
                  className='nav-Navlink'
                  onClick={() => {
                    logout();
                    setUser(null);
                  }}>
                  Logout
                </a>
              </NavLink>
            ) : (
              <NavLink href='/login'>
                <a className='nav-Navlink'>Sign in</a>
              </NavLink>
            )}
          </NavItem>
        </Navbar>
      </header>
      <Container>{props.children}</Container>
    </div>
  );
};

export default Layout;
